INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 0, 1, 2, 80001, 0, 102001, 0, "", 27, "ミミ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 1, 0, 2, 2, 80001, 0, 100401, 0, "", 28, "ミソギ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 0, 2, 2, 80001, 0, 100401, 0, "", 29, "ミソギ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 1, 0, 0, 3, 80001, 0, 101001, 0, "", 30, "マホ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 2, 0, 0, 3, 80001, 0, 101001, 0, "", 31, "マホ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 0, 1, 3, 80001, 0, 104401, 0, "", 32, "イリヤ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 2, 0, 1, 3, 80001, 0, 104401, 0, "", 33, "イリヤ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 1, 0, 2, 3, 80001, 0, 101701, 0, "", 34, "カオリ");
INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES ("これからも、どうぞよろしく\nお願いするさ～！", 2, 0, 2, 3, 80001, 0, 101701, 0, "", 35, "カオリ");
